INSERT INTO `book` (`image`, `book_name`, `author`, `synopsis`) VALUES
(, 'Harry Potter and the Deathly Hallows ', 'J. K. Rowling', 'Without the guidance and protection of their professors, Ron and Hermione begin a mission to destroy the Horcruxes, the sources of Voldemort\'s immortality. Though they must rely on one another more than ever, dark forces threaten to tear them apart. Voldemort\'s Death Eaters have seized control of the Ministry of Magic and Hogwarts, and they are searching for Harry -- even as he and his friends prepare for the ultimate showdown.');
INSERT INTO `book` (`image`, `book_name`, `author`, `synopsis`) VALUES
(, 'Aku Seorang Jutawan ', 'KHAIROLR ', 'seorang pemuzik berbakat besar dalam industri muzik tanah air telah berpindah kapal ke persada network marketing pada penghujung tahun 2005. Beliau diberi gelaran \'Raja Flyers\', kerana flyers yang beliau karang amat berbeza daripada biasa serta telah menjadi satu revolusi baru dalam industri ini. Beliau juga merupakan pengarang buku \'Millionaire in the making-Jadi Jutawan Cara Khairol R\' yang mana buku itu telah mengubah nasib ribuan pembacanya kebanyakannya terdiri daripada jaringan beliau..!\r\n..Menjadi jutawan dalam tempoh 15 bulan sahaja, beliau mempunyai pandangan serta strategi yang amat berbeza serta sentiasa mencuba banyak perkara baru bagi membolehkan beliau berjaya mencapai matlamat income melebihi RM500,000 sebulan!\r\n');
INSERT INTO `book` (`image`, `book_name`, `author`, `synopsis`) VALUES
(, 'KASUT KELOPAK JANTUNG ', 'Ghazali Lateh ', 'Cerpen ini mengisahkan Cikgu Harun yang menerima bungkusan hadiah setiap tahun, terutamanya pada Hari Guru teringat semula peristiwa yang berlaku tiga puluh tahun dahulu sewakta beliau bertugas sebagai guru di kawasan pedalaman. Cikgu Harun sememangnya seorang guru yang tegas dalam soal keceriaan pelajar dan kelas. Beliau memarahi Ahmad yang tidak memakai kasut sekolah walaupun sudah tiga minggu sesi pesekolahan bermula. Di padang sekolah, Ahmad sekali lagi dimarahi Cikgu Harun kerana tidak membawa pakaian sukan. Oleh sebab itu, Cikgu Harun mendenda Ahmad dengan menyuruhnya mancari tali rafia untuk mengikat kelopak jantung pisang pada bahagian kakinya untuk dijadikan kasut. Ahmad merupakan murid yang patuh akan arahan gurunya terus mengikat kelopak jantung pisang. Dia berasa malu atas denda yang dikenakan oleh Cikgu Harun yang sebenarnya mahu Ahmad membeli kasut sekolah demi keselamatan kakinya');
INSERT INTO `book` (`image`, `book_name`, `author`, `synopsis`) VALUES
(, 'Puss in Boot', 'Charles Perraults', '\"Puss in Boots\" is a timeless fairy tale featuring a resourceful and charismatic cat named Puss. When a poor miller\'s youngest son inherits only a cat, Puss dons a pair of boots and embarks on a series of clever adventures to secure his master\'s fortune. Through a series of cunning tricks, he deceives kings and ogres, ultimately helping his master become a prince and marry a princess. This charming tale underscores the power of wit and the notion that appearances can be misleading.');

